使用ThreadLocal,线程重用导致信息错乱
程序运行在 Tomcat 中,执行程序的线程是 Tomcat 的工作线程,而 Tomcat 的工作线程是基于线程池的.一旦线程重用,那么很可能首次从 ThreadLocal 获取的值是之前其他用户的请求遗留的值
生产环境不要使用e.printStackTrace()
因为它占用太多内存,造成锁死,并且,日志交错混合,也不易读 
