public class JSON_BUG {
    public static void main(String[] args) {

        Long idValue = 3000L;
        Map data = new HashMap<>(2);
        data.put("id", idValue);
        data.put("name", "小A");

        System.out.println(idValue ==  data.get("id"));//输出： true
