Metaspace（元空间）
空间的本质和永久代类似,都是对JVM规范中方法区的实现.不过元空间与永久代之间最大的区别在于：元空间并不在虚拟机中,而是使用本地内存.因此,默认情况下,元空间的大小仅受本地内存限制
