 *      一般情况下,testLongs[0],testLongs[1],testLongs[2],testLongs[3]会加载到同一个CPU Cache Line
 * 每当线程修改其中一个元素,都会该行CPU Cache Line失效,从而导致其他线程重新从主存中获取该数组,
 * 而且多个线程同时操作同一缓存行,会发生资源竞争,从而降低读写效率
