public class SprBuilder {
    private final Supplier instantiator;
    private List> modifier = new ArrayList<>();
    public SprBuilder (Supplier instantiator) {
        this.instantiator = instantiator;
    }
    public static  SprBuilder of (Supplier instantiator) {
        return new SprBuilder<>(instantiator);
    }
    public  SprBuilder with (Consumer1 consumer, P1 p1) {
        Consumer c = instance -> consumer.accept(instance, p1);
        modifier.add(c);
        return this;
    }
    public  SprBuilder with (Consumer2 consumer, P1 p1, P2 p2) {
        Consumer c = instance -> consumer.accept(instance, p1, p2);
        modifier.add(c);
        return this;
    }
    public  SprBuilder with (Consumer3 consumer, P1 p1, P2 p2, P3 p3) {
        Consumer c = instance -> consumer.accept(instance, p1, p2, p3);
        modifier.add(c);
        return this;
    }
    public T build () {
        T value = instantiator.get();
        modifier.forEach(modifier -> modifier.accept(value));
        modifier.clear();
        return value;
    }
    @FunctionalInterface
    public interface Consumer1 {
        void accept (T t, P1 p1);
    }
    @FunctionalInterface
    public interface Consumer2 {
        void accept (T t, P1 p1, P2 p2);
    }
    @FunctionalInterface
    public interface Consumer3 {
        void accept (T t, P1 p1, P2 p2, P3 p3);
    }
}

